import {Link} from "react-router-dom";
import "./contact.css";


const Header=()=>{
  return(
    <header className="myheader">
        <Link to="/">Intro</Link>
        <Link to="/about">About</Link>
        <Link to="/mywork">Work</Link>
        <Link to="/contact">Contact</Link>
    </header>
  )
}

export default Header
